import InteriorDesignGaller from '../../../Json/InteriorDesign';

export default class Proj extends Component { 
    photo = InteriorDesignGaller[0].imageUrl
    render() {
        return (
            <div>
                HELOOLF
                <img src={photo} class="img-fluid" alt="Responsive image"></img>
            </div>
        )
    }
}
